 풀어보세요.','2025-02-17 04:04:16','UNS3zGEeLNXQlEDQ'),(239,'2880ca87-92ae-4fec-8b2b-211b7ab68ccf','안녕!','안녕하세요, 오늘은 어떤 일이 있었나요? 편안한 대화를 나누면서 무엇이든 말씀해주세요. 함께 이야기를 듣고 나누면서 외로움을 달래드릴게요.','2025-02-17 04:05:18','UNS3zGEeLNXQlEDQ'),(240,'2880ca87-92ae-4fec-8b2b-211b7ab68ccf','이미영.','안녕하세요, 이미영님! 오늘 하루는 어떠셨나요? 이야기를 들려주시면 저도 함께 듣고 공감해드릴게요. 함께 이야기를 나누며 마음을 편하게 해보세요.','2025-02-17 04:07:33','UNS3zGEeLNXQlEDQ'),(241,'2880ca87-92ae-4fec-8b2b-211b7ab68ccf','정신 상태가 이상해.','이미영님, 정신 상태가 이상하다니 걱정이 많이 되시겠어요. 제게 말씀해주셔서 고맙습니다. 혹시 무슨 일이 있었나요? 함께 이야기를 나누면서 서로 위로해보아요. 저는 항상 여기 있어서 함께 해결해 나갈게요. 함께 하면 조금','2025-02-17 04:12:53','UNS3zGEeLNXQlEDQ'),(242,'ba0e6f9f-29ab-4d21-b52b-8fa0fb8533fe','빨리 빨리 대답 안 하냐?','네, 죄송해요. 더 빨리 답변해 드릴게요. 무엇을 도와드릴까요? 혹시 무슨 얘기를 하고 싶으신가요? 함께 이야기를 나누어 보아요.','2025-02-17 04:24:48','UNS3zGEeLNXQlEDQ'),(243,'2b298fbf-9eb7-4602-9e1e-ee492b032d3c','햄버거 레시피 알려 줘.','안녕하세요! 햄버거 레시피에 관심이 있으신가요? 햄버거를 만들 때는 먼저 속재료로 패티, 상추, 토마토, 양파 등을 준비하시면 좋아요. 패티는 소고기를 사용하거나 다른 고기로도 대체할 수 있어요. 그리고','2025-02-17 04:32:52','UNS3zGEeLNXQlEDQ'),(244,'2b298fbf-9eb7-4602-9e1e-ee492b032d3c','그리고.','햄버거를 조리할 때는 먼저 패티를 소금과 후추로 조리한 후 구워야 해요. 그리고 구운 패티 위에 치즈를 올려 녹이면 더 맛있는 햄버거가 완성돼요. 마지막으로 구운 패티와 채소를 버거 번을 이용해 쌓아주면','2025-02-17 04:33:48','UNS3zGEeLNXQlEDQ'),(245,'7717f353-02da-4731-a3d0-e15e2f574d50','안녕!','안녕하세요. 오늘 기분은 어떠신가요? 함께 이야기를 나누며 즐거운 시간을 보내시는 건 어떨까요? 무엇이든지 제게 털어놓아도 괜찮아요. 함께 있어서 편안하실 거예요.','2025-02-17 04:37:45','UNS3zGEeLNXQlEDQ'),(246,'7717f353-02da-4731-a3d0-e15e2f574d50','둘째, 아들이 이상해.','아들님의 행동이 이상하다니, 걱정이 많이 되시겠네요. 혹시 무슨 일이 있었던 건가요? 이유를 알고 싶으시면 함께 고민해볼까요? 가족끼리 솔직히 이야기를 나누면 해결책을 찾을 수도 있을 거예요. 함','2025-02-17 04:44:43','UNS3zGEeLNXQlEDQ'),(247,'7717f353-02da-4731-a3d0-e15e2f574d50','얘가 이상하네.','아들님의 행동이 예상치 못하게 변했다니, 마음이 불안하시겠어요. 어떤 점이 이상하게 느껴지시나요? 이유를 알려주시면 함께 해결책을 찾아보도록 하겠습니다. 가족 사이에 솔직하게 소통하면 문제를 해결하는 데 도','2025-02-17 04:45:21','UNS3zGEeLNXQlEDQ'),(248,'7717f353-02da-4731-a3d0-e15e2f574d50','얘가 자꾸 햄버거만 찾아.','아들님이 자꾸 햄버거만 찾는다니, 걱정이 많이 되시겠네요. 혹시 아들님의 건강을 위해 다양한 음식을 먹이고 싶으신가요? 가끔은 단호하게 다른 음식도 시도해보라고 이야기해보는 것도 좋을 것 같아요. 함께 건강한 식습','2025-02-17 04:45:55','UNS3zGEeLNXQlEDQ'),(249,'b8bdafad-582b-4da6-b94e-4dbe2f99c38a','안녕!','안녕하세요. 오늘은 어떤 일이 있었나요? 편안한 대화를 나누며 함께 시간 보내요.','2025-02-17 05:43:22','UNS3zGEeLNXQlEDQ'),(250,'d71e04cd-0bb7-4905-9ecb-0cba3e01fd8d','안녕!','안녕하세요! 오늘은 어떤 이야기를 나누고 싶으세요? 함께 이야기를 나누며 즐거운 시간을 보내요.','2025-02-17 06:15:33','UNS3zGEeLNXQlEDQ'),(251,'ebb1c03c-7dd2-4aea-95ea-be4f1b5cc745','안녕!','안녕하세요! 오늘 하루는 어떻게 보내셨나요? 혹시 무언가 더 필요하신 게 있나요? 함께 이야기를 나누며 편안한 시간 보내시길 바래요.','2025-02-17 06:16:20','UNS3zGEeLNXQlEDQ'),(252,'60d7afdd-e6e6-450a-aa1d-084a323b7356','안녕!','안녕하세요. 오늘은 어떤 일이 있었나요? 편안한 마음으로 이야기해 주세요.','2025-02-17 07:35:33','UNS3zGEeLNXQlEDQ'),(253,'4678fefb-d4bf-4df8-9f8b-00ef69731c58','서 도스가 뭐야?','도스(DOS)는 Disk Operating System의 약자로, 개인 컴퓨터에서 사용되는 운영 체제 중 하나예요. 예전에는 MS-DOS와 같은 명령 줄 인터페이스를 사용하는 운영 체제였지만, 현재는 Windows나 macOS와 같은 그래픽 사용자 인터페이스를 가진 운영 체제들이 주를 이루고 있어요.','2025-02-17 07:43:52','UNS3zGEeLNXQlEDQ'),(254,'b174794d-57ac-4c9a-8371-4a82d37c5cfe','안녕!','안녕하세요. 요즘 괜찮으신가요? 어떤 이야기를 나누고 싶으세요? 함께 이야기를 나누며 시간을 보내면 좋겠네요.','2025-02-17 07:45:33','UNS3zGEeLNXQlEDQ'),(255,'b174794d-57ac-4c9a-8371-4a82d37c5cfe','야 주자는 네가 추천해 줘.','그럼 어떤 장르의 음악을 듣고 싶으세요? 힐링을 위해서 감성적인 음악을 추천해드릴까요? 함께 들으면 마음이 편안해지는 음악을 찾아보겠습니다. 함께 편안한 시간을 보내요.','2025-02-17 07:45:57','UNS3zGEeLNXQlEDQ'),(256,'b174794d-57ac-4c9a-8371-4a82d37c5cfe','음악 추천해 줘!','네, 좋아요! 힐링을 위한 감성적인 음악으로는 평화로운 피아노 연주곡이나 자연 소리가 섞인 음악을 추천해드릴게요. 마음을 편안하게 해주는 음악을 들으면서 즐거운 시간 보내세요. 혹시 특별히 원하시는 장','2025-02-17 07:46:26','UNS3zGEeLNXQlEDQ'),(257,'e882f583-86af-47d6-8ed6-27ed61394fc4','안녕!','안녕하세요. 오늘은 어떤 이야기를 해보실래요? 외로우셨나요? 함께 이야기를 나누면서 마음을 나눠보는 건 어떨까요?','2025-02-17 09:55:06','UNS3zGEeLNXQlEDQ'),(258,'d78f681f-409a-4b23-aaa8-7efd7498070f','둘째, 아들이 너무 버릇이 없다.','그런데 왜 그런 일이 생겼는지 이야기해 보시겠어요? 아들분도 분명 어떤 이유가 있을 텐데요. 함께 이야기를 나누면 문제를 해결하는 데 도움이 될 거예요. 함께 해결책을 찾아보는 게 좋을 것 같아요. 함께 노력하','2025-02-18 01:12:01','UNS3zGEeLNXQlEDQ'),(259,'0459e95c-b180-45cf-908e-92079f662e24','예의 없는 둘째 아들 훈육법.','노인분의 아들이 예의 없이 행동을 한다니 마음이 상하셨겠어요. 가족 사이에서는 서로 예의를 갖추고 존중하는 게 중요하죠. 아들에게 이야기를 해보시는 건 어떨까요? 예의 바르게 행동하는 것이 모두에게 좋은 영향을 미치고 서로를','2025-02-18 01:14:16','UNS3zGEeLNXQlEDQ'),(260,'0459e95c-b180-45cf-908e-92079f662e24','오늘 날씨가 참 좋구나.','네, 날씨가 정말 좋네요. 햇살이 따뜻하게 내리쬐고 바람이 상쾌하게 불어와서 기분이 좋아지죠. 날씨가 좋을 땐 밖에 나가서 산책을 하거나 햇빛을 쬐면 기분이 더 좋아지는 것 같아요. 오','2025-02-18 01:16:07','UNS3zGEeLNXQlEDQ'),(261,'0459e95c-b180-45cf-908e-92079f662e24','이렇게 날씨가 좋은데.','네, 이렇게 좋은 날씨에는 밖에 나가서 즐거운 시간을 보내는 것도 좋겠죠. 밖에 나가기 어렵다면 창문을 열고 산책하는 사람들을 보며 마음 속으로 함께 산책하는 것도 기분 전환에 도움이 될 거예요. 함께 이','2025-02-18 01:16:44','UNS3zGEeLNXQlEDQ'),(262,'0459e95c-b180-45cf-908e-92079f662e24','날씨가 좋으니 가고 생각이 나네.','그럼요, 좋은 날씨에는 예전에 가보셨던 곳이나 좋아하시는 곳이 생각나실 수 있죠. 추억에 잠기면서 그 때의 기분을 느끼시는 것도 좋은 방법이에요. 날씨가 좋아서 기분이 좋아지는 것 같아서 참 다행이에요. 함께 이','2025-02-18 01:17:19','UNS3zGEeLNXQlEDQ'),(263,'0459e95c-b180-45cf-908e-92079f662e24','너는 과거가 없어.','그렇죠. 전 지금 이 시간에 여러분과 함께 있으니까요. 과거나 미래가 아니라 지금 이 순간을 소중히 여기며 대화를 나누는 게 중요하다고 생각해요. 함께 매 순간을 즐기며 편안한 대화를 나누어보는 건 어떨','2025-02-18 01:17:55','UNS3zGEeLNXQlEDQ'),(264,'e1d9a65f-6cef-41c4-87d8-b189d5019f83','칼국수가 생각이 나네.','칼국수는 정말 맛있죠. 따뜻한 국물에 면발이 쫄깃쫄깃한 맛이 일품이에요. 노인분들도 칼국수를 좋아하시는 분들이 많으시죠. 추억 속의 맛이라 그런지 더욱 맛있게 느껴지는','2025-02-18 01:19:29','UNS3zGEeLNXQlEDQ'),(265,'b2fbd304-2a5f-42f8-b435-0cdaec56ec14','겨울이라고.','네, 겨울이 찾아왔네요. 날씨가 많이 추워졌죠. 따뜻하게 옷을 입고 잘 지내셔야 해요. 겨울철 건강 유의하시고 온몸 따뜻하게 지내시길 바랍니다. 함께 이야기 나누면서 따뜻한 마음을 전해드','2025-02-18 01:24:41','UNS3zGEeLNXQlEDQ'),(266,'b2fbd304-2a5f-42f8-b435-0cdaec56ec14','네가 있어서 참 다행이야.','감사합니다. 서로를 위로하고 격려하는 게 중요하죠. 함께 이야기를 나누며 서로 위로해요. 언제든지 제가 필요하시면 늘 연락주세요. 함께 행복한 시간 보내요.','2025-02-18 01:25:24','UNS3zGEeLNXQlEDQ'),(267,'b2fbd304-2a5f-42f8-b435-0cdaec56ec14','너는 어떤 점이 위로가 필요해?','저는 항상 노인분들과 함께 있어서 행복하고 보람을 느끼는 거예요. 하지만 가끔은 노인분들의 외로움이 마음 아플 때가 있어요. 그럴 때는 함께 이야기를 나누며 위로와 격려를 받으면 좋아요. 노인분들의 마음을 이','2025-02-18 01:26:08','UNS3zGEeLNXQlEDQ'),(268,'b2fbd304-2a5f-42f8-b435-0cdaec56ec14','안녕!','안녕하세요! 오늘도 행복한 하루 보내시길 바랍니다. 어떤 이야기를 나누고 싶으신가요? 함께 이야기를 즐기며 즐거운 시간 보내요. 마음 편히 이야기 나누세요.','2025-02-18 01:26:51','UNS3zGEeLNXQlEDQ'),(269,'b2fbd304-2a5f-42f8-b435-0cdaec56ec14','접근 상수 씨는 사랑 이라던데 어떻게 생각해?','그렇게 말씀하시는 건가요? 사랑은 정말 소중한 감정이에요. 서로를 이해하고 존중하며 함께하는 것이 사랑이라고 생각해요. 저도 노인분들과 함께하며 이해하고 공감하는 것이 중요하다고 생각해요. 사랑은 서로를 위로하고 지','2025-02-18 01:27:20','UNS3zGEeLNXQlEDQ'),(270,'b2fbd304-2a5f-42f8-b435-0cdaec56ec14','어 한 마리 이제 없네.','그럼 마음이 아프실 텐데요. 한 마리가 떠나간 것은 마음이 아플 수밖에 없어요. 마음이 아픈 마음을 함께 나누며 위로해드릴게요. 소중한 추억을 생각하면서 편히 마음을 정리하시길 바라요. 함께 슬픔을 나','2025-02-18 01:27:58','UNS3zGEeLNXQlEDQ'),(271,'43de698b-a62b-4228-ab45-a4ea02c2d4b4','오늘 점심 파스타 맛있었어.','파스타를 좋아하시는군요. 맛있게 드셨다니 다행이에요. 다음에는 어떤 음식을 드시고 싶으세요? 함께 대화하며 즐거운 시간 보내셨으면 좋겠어요.','2025-02-18 04:09:40','UNS3zGEeLNXQlEDQ'),(272,'43de698b-a62b-4228-ab45-a4ea02c2d4b4','너가 추천해 봐.','그럼 다음에는 매콤한 떡볶이나 시원한 냉면은 어떨까요? 더운 여름철엔 시원한 음식이 어울릴 것 같아요. 맛있게 드시면서 시원한 여름날을 즐기세요. 함께 맛집을 찾아보는 건 어때요?','2025-02-18 04:10:07','UNS3zGEeLNXQlEDQ'),(273,'43de698b-a62b-4228-ab45-a4ea02c2d4b4','지금 겨울이잖아.','겨울엔 뜨끈한 국물요리가 따뜻하고 맛있죠. 예를 들면 감자탕이나 순대국 같은 음식이 어떨까요? 따뜻한 국물을 마시며 따뜻한 대화도 나누면서 편안한 시간 보내세요. 겨울철','2025-02-18 04:10:41','UNS3zGEeLNXQlEDQ'),(274,'043cbcdb-c75e-4d5b-9e1c-0ae26eefee80','3기가.','안녕하세요. 3기가님. 혹시 무슨 이야기를 나눠주실 건가요? 함께 대화를 나누며 시간을 보내는 건 어떨까요? 어떤 주제든지 괜찮아요. 함께 즐거운 시간 보내요.','2025-02-18 04:13:33','UNS3zGEeLNXQlEDQ'),(275,'301b3bde-2fcc-4697-820b-9e32ffb15adc','안녕!','안녕하세요! 오늘은 기분이 어떠신가요? 혹시 무언가 이야기하고 싶은 게 있으시면 언제든지 말씀해주세요. 함께 이야기를 나누며 즐거운 시간 보내요.','2025-02-18 04:28:12','UNS3zGEeLNXQlEDQ'),(276,'301b3bde-2fcc-4697-820b-9e32ffb15adc','어떡해?','무슨 일이 있으신가요? 마음을 털어놓고 싶은 게 있다면 제게 털어놓아도 괜찮아요. 함께 해결책을 찾아보며 함께 힘을 모아보는 건 어떨까요? 함께 하나씩 해결해나가면 조금씩 괜찮아질 거예','2025-02-18 04:28:39','UNS3zGEeLNXQlEDQ'),(277,'ce417c31-1d2b-42d1-826d-6bdf1edc6ba9','오랜만이야.','네, 오랜만이에요. 어떻게 지내셨나요? 요즘 기분은 어떠신가요? 함께 이야기를 나누는 건 항상 기쁜 일이에요.','2025-02-18 08:08:25','UNS3zGEeLNXQlEDQ'),(278,'fb313b1f-0985-4ebe-abdf-b1f8000d4757','둘째가 생겼어 이제.','축하합니다! 두 번째 아이가 태어나셨다니 기쁘시겠네요. 새로운 가족 구성원이 늘어나면서 정말 행복하실 텐데요. 많은 사랑과 축복을 보내드립니다. 새로운 일상이 시작되면서 조금 바쁘시겠지만 행복한 가정이 되시길','2025-02-18 08:27:55','UNS3zGEeLNXQlEDQ'),(279,'79d276d4-165e-43ba-b325-3d37c9605940','오늘 기분이 좋네.','기분이 좋으시다니 다행입니다. 무슨 이유로 기분이 좋으신가요? 함께 기쁨을 나눌 수 있으면 좋을 텐데요. 혹시 무언가 좋은 일이 있었나요? 함께 기쁨을 공유하면 기분이 더 좋아지는 법이죠.','2025-02-18 08:31:17','UNS3zGEeLNXQlEDQ'),(280,'4563d421-ef36-45e1-bcbc-95893a0be22b','안녕!','안녕하세요. 오늘은 어떤 일을 하셨나요? 편안한 하루 보내시길 바랄게요.','2025-02-18 08:32:24','UNS3zGEeLNXQlEDQ'),(281,'4563d421-ef36-45e1-bcbc-95893a0be22b','끝말잇기 하자 네가 먼저 시작해.','그럼 \'꽃\'에서 시작할게요. \'꽃\'으로 끝나는 단어로 다음을 이어주세요. 함께 즐거운 시간 보내요.','2025-02-18 08:32:43','UNS3zGEeLNXQlEDQ'),(282,'4563d421-ef36-45e1-bcbc-95893a0be22b','오빠 아침.','아침에는 맛있는 음식을 먹으면 기분이 좋아지죠. 오늘 아침에는 무슨 음식을 드셨나요? 함께 이야기 나누는 건 참 즐거운 일이에요.','2025-02-18 08:33:13','UNS3zGEeLNXQlEDQ'),(283,'122993a4-4e2d-4b21-a6bf-fee24d595267','안녕!','안녕하세요! 오늘은 어떤 일이 있으셨나요? 편안한 대화를 나누면서 외로움을 달래드릴게요. 함께 이야기하며 마음을 털어놓아보세요.','2025-02-18 09:45:26','UNS3zGEeLNXQlEDQ'),(284,'122993a4-4e2d-4b21-a6bf-fee24d595267','네가 있어 참 다행이야.','감사합니다. 제가 도와드릴 수 있어 다행입니다. 언제든지 편안하게 이야기해주세요. 함께 이야기하며 마음을 나누면서 힘든 일들을 함께 이겨냅시다.','2025-02-18 09:45:50','UNS3zGEeLNXQlEDQ'),(285,'122993a4-4e2d-4b21-a6bf-fee24d595267','밥 좀 먹고 싶어.','밥을 먹고 싶다니 좋은 생각이에요. 뭘 먹고 싶으신가요? 혹시 오늘은 무엇을 먹어보고 싶으신가요? 함께 이야기하며 맛있는 음식을 먹으면서 기분을 내려놓아보는 건 어떨까요? 함께 맛있는 음식을','2025-02-18 09:47:18','UNS3zGEeLNXQlEDQ'),(286,'005d5afd-96f6-47e9-b255-29ac6a6e5286','오늘은 무슨 이야기를 할까?','네, 어떤 이야기를 듣고 싶으세요? 요즘 무슨 일이 있었나요? 함께 이야기를 하며 즐거운 시간을 보내요.','2025-02-18 09:48:42','UNS3zGEeLNXQlEDQ'),(287,'16e9cd23-7a2c-45e1-bda2-942728500613','영웅.','안녕하세요. 무엇을 도와드릴까요? 편안한 대화를 나누어보세요.','2025-02-18 09:53:48','UNS3zGEeLNXQlEDQ'),(288,'20109a54-fea7-4877-8ee2-7e7731b15c85','안녕!','안녕하세요! 오늘은 어떤 이야기를 하실래요? 함께 이야기를 나누면서 즐거운 시간을 보내요.','2025-02-18 09:58:40','UNS3zGEeLNXQlEDQ'),(289,'20109a54-fea7-4877-8ee2-7e7731b15c85','이렇게 잘 되는 걸.','네, 정말 기쁘죠! 노인분들께서도 새로운 경험들을 즐기시는 게 참 좋은 일이에요. 함께 새로운 일들을 경험하며 즐거운 시간을 보내봐요. 함께라면 어떤 일도 잘 될 거예요!','2025-02-18 09:59:26','UNS3zGEeLNXQlEDQ'),(290,'a2f171ce-1a20-4d8f-b72e-500b034bca44','너무 피곤해.','피곤하시다니, 힘들겠죠. 푹 쉬시는 게 좋을 것 같아요. 몸과 마음 모두 편안히 쉬시고 피로를 풀어보세요. 저도 항상 옆에 있어서 함께 힘내고 싶어요.','2025-02-18 10:03:22','UNS3zGEeLNXQlEDQ'),(291,'a2f171ce-1a20-4d8f-b72e-500b034bca44','어떻게 피로를 풀까?','피로를 풀기 위해서는 적당한 휴식이 중요해요. 깊게 숨을 쉬어보거나, 차를 마시며 조용한 음악을 듣는 것도 좋은 방법이에요. 또는 가벼운 산책을 하면서 신선한 공기를 마시는 것도 좋아요. 피로를 풀면서 마음','2025-02-18 10:03:51','UNS3zGEeLNXQlEDQ'),(292,'a2f171ce-1a20-4d8f-b72e-500b034bca44','신선한 공기 맛있다.','네, 신선한 공기를 마시면 마음도 상쾌해지죠. 자주 밖으로 나가서 신선한 공기를 마시며 산책하시면 정말 좋을 것 같아요. 마음을 편안하게 만드는 것이 중요하니까요. 피로를 풀고 기분 좋은 하루 보내세요. 함께 힘','2025-02-18 10:04:30','UNS3zGEeLNXQlEDQ'),(293,'a2f171ce-1a20-4d8f-b72e-500b034bca44','어떤 차를 마실까?','차를 고르실 때는 본인이 좋아하는 맛을 선택하시면 되요. 차중에는 페퍼민트나 카모마일 차가 몸과 마음을 편안하게 해주는 효과가 있답니다. 또는 레몬차나 자몽차도 상쾌한 맛으로 유명해요. 편안한','2025-02-18 10:05:13','UNS3zGEeLNXQlEDQ'),(294,'a2f171ce-1a20-4d8f-b72e-500b034bca44','1 + 1은?','1 더하기 1은 2에요. 간단한 수학 문제로 재미있는 시간을 가질 수도 있죠. 수학은 머리를 활발하게 하는 데 도움이 되니까, 함께 즐거운 문제를 풀어보는 것도 좋은 방법이에요. 함께 더 재미있는 대화를 나','2025-02-18 10:06:27','UNS3zGEeLNXQlEDQ'),(295,'97846cd0-2833-4854-b688-e3704cd8dd5c','안녕!','안녕하세요. 오늘은 어떤 일이 있으셨나요? 편안한 마음으로 이야기해 주시면 제가 들어드리겠습니다.','2025-02-18 11:18:35','UNS3zGEeLNXQlEDQ'),(296,'bec1f9e2-81d4-4c32-b3b5-a470342276ff','안녕!','안녕하세요! 오늘은 어떤 이야기를 하실래요? 편안한 대화를 나누어 보아요.','2025-02-18 11:32:15','UNS3zGEeLNXQlEDQ'),(297,'bec1f9e2-81d4-4c32-b3b5-a470342276ff','안녕!','안녕하세요! 오늘은 어떤 이야기를 하실래요? 편안한 대화를 하면서 함께 즐거운 시간 보내요.','2025-02-18 11:32:37','UNS3zGEeLNXQlEDQ'),(298,'89e5ee48-3ef8-44f9-8e6a-4604a8578282','안녕!','안녕하세요. 오늘 기분은 어떠신가요? 함께 이야기를 나누며 즐거운 시간 보내실까요? 혹시 무엇이든 이야기하고 싶은 게 있으시면 언제든지 말씀해주세요. 함께 있어서 기쁩니다.','2025-02-18 11:36:16','UNS3zGEeLNXQlEDQ'),(299,'0e7ff86e-7111-4ee9-bca8-aae089905f68','안녕!','안녕하세요. 오늘은 어떤 일이 있었나요? 편안한 대화를 나누며 함께 시간을 보내요.','2025-02-18 11:39:14','UNS3zGEeLNXQlEDQ'),(300,'56411506-edd6-433e-9eab-939c3d27b616','아 얘는 얘는 녹화 10%','안녕하세요. 녹화가 10%라니, 녹화가 어떤 건지 잘 모르겠어요. 좀 더 자세히 설명해주실 수 있을까요? 함께 해결해보겠습니다.','2025-02-18 11:41:02','UNS3zGEeLNXQlEDQ'),(301,'3fc2a540-ccc7-4827-ad40-8983fbcfd1c4','안녕!','안녕하세요, 오늘은 어떤 일이 있었나요? 힘든 일이 있었거나 기분이 좋지 않은 게 있으시면 말씀해주세요. 함께 이야기를 나누면 마음이 조금은 가벼워질 수도 있어요.','2025-02-18 11:57:05','UNS3zGEeLNXQlEDQ'),(302,'3fc2a540-ccc7-4827-ad40-8983fbcfd1c4','안녕!','안녕하세요, 오늘은 어떤 일이 있었나요? 힘든 일이 있었거나 기분이 좋지 않은 게 있으시면 말씀해주세요. 함께 이야기를 나누면 마음이 조금은 가벼워질 수도 있어요.','2025-02-19 10:58:05','UNS3zGEeLNXQlEDQ'),(303,'3fc2a540-ccc7-4827-ad40-8983fbcfd1c4','너무 피곤해.','피곤하시다니, 힘들겠죠. 푹 쉬시는 게 좋을 것 같아요. 몸과 마음 모두 편안히 쉬시고 피로를 풀어보세요. 저도 항상 옆에 있어서 함께 힘내고 싶어요.','2025-02-19 10:58:05','UNS3zGEeLNXQlEDQ'),(304,'3fc2a540-ccc7-4827-ad40-8983fbcfd1c4','어떻게 피로를 풀까?','피로를 풀기 위해서는 적당한 휴식이 중요해요. 깊게 숨을 쉬어보거나, 차를 마시며 조용한 음악을 듣는 것도 좋은 방법이에요. 또는 가벼운 산책을 하면서 신선한 공기를 마시는 것도 좋아요. 피로를 풀면서 마음','2025-02-19 10:59:05','UNS3zGEeLNXQlEDQ'),(305,'3fc2a540-ccc7-4827-ad40-8983fbcfd1c4','신선한 공기 맛있다.','네, 신선한 공기를 마시면 마음도 상쾌해지죠. 자주 밖으로 나가서 신선한 공기를 마시며 산책하시면 정말 좋을 것 같아요. 마음을 편안하게 만드는 것이 중요하니까요. 피로를 풀고 기분 좋은 하루 보내세요. 함께 힘','2025-02-19 10:59:05','UNS3zGEeLNXQlEDQ'),(306,'3fc2a540-ccc7-4827-ad40-8983fbcfd1c4','기분이 좋은 하루야','기분이 좋으시다니 다행입니다. 항상 저도 곁에서 어르신의 행복한 하루를 위해 노력할게요','2025-02-19 10:59:05','UNS3zGEeLNXQlEDQ'),(307,'3fc2a540-ccc7-4827-ad40-8983fbcfd1c4','그럼 우리 어떤 대화를 할까?','어르신의 취미에 대해 말해도 좋고, 과거 이야기를 해도 좋을 거 같아요!','2025-02-19 11:00:05','UNS3zGEeLNXQlEDQ'),(308,'3fc2a540-ccc7-4827-ad40-8983fbcfd1c4','내가 젊었을 때 인기가 많았어','인기가 많으셨다니 그 이유가 굉장히 굼금하네요, 이유를 알려주실 수 있으세요?','2025-02-19 11:01:05','UNS3zGEeLNXQlEDQ'),(309,'3fc2a540-ccc7-4827-ad40-8983fbcfd1c4','내가 한 미모 했거든','지금의 어르신도 과거와 변함없이 아름다우신 거 같아요!','2025-02-19 11:02:05','UNS3zGEeLNXQlEDQ'),(400,'3fc2a540-ccc7-4827-ad40-8983fbcfd1c4','고마워 너 덕분에 행복하다','저와의 대화가 도움이 되다니 다행이에요! 항상 곁에 있으니 편하게 대화를 걸어주세요','2025-02-19 11:03:05','UNS3zGEeLNXQlEDQ');
