--
-- Table structure for table `chatkeywords`
--

DROP TABLE IF EXISTS `chatkeywords`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `chatkeywords` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `family_id` char(16) COLLATE utf8mb4_bin DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT current_timestamp(),
  `keywords` text COLLATE utf8mb4_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `family_id` (`family_id`),
