INSERT INTO `mentalstatus` VALUES (27,'FlcuDLxVC9SolW70','2025-02-07 03:57:41',95,0,'{\"overall_emotional_state\": \"대체로 안정적이나 때때로 고독함을 느낌\", \"emotional_insights\": \"사용자는 대체로 안정적인 감정 상태를 보이며, 일상적인 대화를 즐깁니다. 그러나 때때로 고독함을 느끼는 것으로 보입니다. 이는 사용자가 혼자 있는 시간이 많거나, 사회적인 상호작용이 부족한 것을 의미할 수 있습니다.\", \"time_based_emotions\": {\"13:42\": [\"긍정적\", 70, \"독서에 대한 이야기를 나누며 긍정적인 감정을 표현함\"], \"17:33\": [\"부정적\", 40, \"대화를 별로 좋아하지 않는다고 표현함\"], \"17:34\": [\"긍정적\", 60, \"옛날 이야기를 나누고 싶어하는 긍정적인 감정을 표현함\"], \"18:04\": [\"긍정적\", 70, \"가을 날씨를 좋아하는 긍정적인 감정을 표현함\"], \"18:05\": [\"부정적\", 30, \"고독함을 느끼는 부정적인 감정을 표현함\"]}, \"recommendations\": [\"사용자가 고독함을 느낄 때, 그에게 사회적인 활동을 권장하거나, 친구나 가족과의 연락을 촉진해보세요.\", \"사용자의 취미나 관심사에 대해 더 많이 이야기하며, 그에게 긍정적인 감정을 유발하는 주제로 대화를 이끌어보세요.\"]}'),(28,'FlcuDLxVC9SolW70','2025-02-07 13:48:39',50,1,'{\"overall_emotional_state\": \"감정 상태 분석이 필요합니다.\", \"emotional_insights\": \"더 많은 대화가 필요합니다.\", \"time_based_emotions\": {\"01:55\": [\"중립\", 50, \"감정 상태를 분석할 수 없습니다.\"]}, \"recommendations\": [\"더 많은 대화를 나누어보세요.\"]}'),(32,'FlcuDLxVC9SolW70','2025-02-11 01:42:12',50,0,'{\"overall_emotional_state\": \"감정 상태 분석이 필요합니다.\", \"emotional_insights\": \"더 많은 대화가 필요합니다.\", \"time_based_emotions\": {\"01:25\": [\"중립\", 50, \"감정 상태를 분석할 수 없습니다.\"]}, \"recommendations\": [\"더 많은 대화를 나누어보세요.\"]}'),(33,'FlcuDLxVC9SolW70','2025-02-11 01:47:35',50,0,'{\"overall_emotional_state\": \"감정 상태 분석이 필요합니다.\", \"emotional_insights\": \"더 많은 대화가 필요합니다.\", \"time_based_emotions\": {\"01:25\": [\"중립\", 50, \"감정 상태를 분석할 수 없습니다.\"]}, \"recommendations\": [\"더 많은 대화를 나누어보세요.\"]}'),(34,'FlcuDLxVC9SolW70','2025-02-11 01:51:01',47,0,'{\"overall_emotional_state\": \"외로움과 슬픔이 가득한 상태\", \"emotional_insights\": \"사용자는 외로움과 슬픔을 느끼고 있습니다. 특히, 가고님에 대한 생각이 사용자의 감정 상태에 영향을 미치고 있습니다.\", \"time_based_emotions\": {\"01:01\": [\"긍정적\", 70, \"사용자가 처음 인사를 건넸을 때의 기분\"], \"01:03\": [\"긍정적\", 70, \"사용자가 두 번째로 인사를 건넸을 때의 기분\"], \"01:13\": [\"긍정적\", 70, \"사용자가 세 번째로 인사를 건넸을 때의 기분\"], \"01:14\": [\"부정적\", 20, \"사용자가 외로움을 표현했을 때의 기분\"], \"01:15\": [\"긍정적\", 50, \"사용자가 대화 주제를 물어봤을 때의 기분\"], \"01:18\": [\"부정적\", 20, \"사용자가 슬픔을 표현했을 때의 기분\"], \"01:25\": [\"부정적\", 30, \"사용자가 가고님에 대한 생각을 표현했을 때의 기분\"]}, \"recommendations\": [\"사용자에게 따뜻한 위로의 말을 전해주세요.\", \"사용자가 좋아하는 활동이나 취미에 대해 이야기해보세요.\"]}'),(35,'FlcuDLxVC9SolW70','2025-02-13 03:47:28',90,0,'{\"overall_emotional_state\": \"피곤하고 졸림\", \"emotional_insights\": \"사용자는 현재 매우 피곤하고 졸리다는 감정을 표현하였습니다. 잠이 부족하거나, 하루 종일 많은 일을 처리하였을 가능성이 있습니다.\", \"time_based_emotions\": {\"03:46\": [\"부정적\", 90, \"사용자가 매우 졸리고 피곤하다고 표현하였습니다. 휴식이 필요한 상태입니다.\"]}, \"recommendations\": [\"편안한 음악을 들으며 휴식을 취하는 것을 추천합니다.\", \"잠이 부족하다면, 충분한 수면을 취하는 것이 좋습니다.\"]}'),(36,'FlcuDLxVC9SolW70','2025-02-13 03:51:22',70,0,'{\"overall_emotional_state\": \"피곤하고 졸림\", \"emotional_insights\": \"사용자는 현재 매우 피곤하고 졸리다는 감정을 표현하였습니다. 이는 잠이 부족하거나, 하루 종일 많은 활동을 한 결과일 수 있습니다.\", \"time_based_emotions\": {\"03:46\": [\"부정적\", 70, \"사용자가 피곤함을 표현하였습니다.\"]}, \"recommendations\": [\"편안한 잠자리를 마련하고, 충분한 휴식을 취하세요.\", \"잠이 부족하다면, 낮잠을 적절히 활용해 보세요.\"]}'),(40,'FlcuDLxVC9SolW70','2025-02-17 06:47:35',55,0,'{\"overall_emotional_state\": \"안정적이고 평온한 감정 상태\", \"emotional_insights\": \"사용자는 대화 동안 안정적이고 평온한 감정 상태를 유지하였습니다. 대부분의 대화가 인사말로 이루어졌으며, 특별한 감정적인 변화는 없었습니다.\", \"time_based_emotions\": {\"00:33\": [\"긍정적\", 70, \"사용자가 처음으로 인사를 건넸을 때\"], \"04:12\": [\"부정적\", 40, \"사용자가 정신 상태가 이상하다고 언급했을 때\"], \"04:32\": [\"긍정적\", 60, \"사용자가 햄버거 레시피를 요청했을 때\"], \"04:44\": [\"부정적\", 50, \"사용자가 아들이 이상하다고 언급했을 때\"]}, \"recommendations\": [\"사용자가 정신 상태가 이상하다고 언급했을 때, 더 많은 정보를 요청하여 사용자의 감정 상태를 이해하려고 노력해보세요.\", \"사용자가 아들에 대해 걱정하는 것처럼 보일 때, 사용자가 더 많은 정보를 제공하도록 격려하고, 가능한 해결책을 제안해보세요.\"]}'),(41,'FlcuDLxVC9SolW70','2025-02-17 06:51:48',72,0,'{\"overall_emotional_state\": \"안정적이고 평화로운 감정 상태\", \"emotional_insights\": \"사용자는 대화를 통해 안정적이고 평화로운 감정 상태를 유지하고 있습니다. 그러나 가끔씩 아들의 행동에 대해 걱정하는 모습을 보였습니다.\", \"time_based_emotions\": {\"00:33\": [\"긍정적\", 80, \"사용자가 처음 인사를 건넸을 때\"], \"04:12\": [\"부정적\", 60, \"사용자가 정신 상태가 이상하다고 말했을 때\"], \"04:24\": [\"부정적\", 70, \"사용자가 빠른 대답을 요구했을 때\"], \"04:44\": [\"부정적\", 65, \"사용자가 아들의 행동에 대해 걱정했을 때\"], \"06:16\": [\"긍정적\", 85, \"사용자가 마지막으로 인사를 건넸을 때\"]}, \"recommendations\": [\"사용자가 아들의 행동에 대해 걱정하는 경우, 아들과의 소통을 권장하고, 필요하다면 전문가의 도움을 받는 것을 제안해보세요.\", \"사용자가 빠른 대답을 원하는 경우, 대화의 흐름을 유지하면서도 빠르게 응답하는 방법을 고려해보세요.\"]}'),(43,'FlcuDLxVC9SolW70','2025-02-17 06:54:54',41,0,'{\"overall_emotional_state\": \"사용자는 반복적인 인사와 간단한 질문을 통해 감정적으로 혼란스러워 보입니다.\", \"emotional_insights\": \"사용자는 반복적으로 인사하며 감정적으로 불안정한 상태를 보입니다. 특히 가족 문제와 관련된 질문에서 불안한 감정이 드러납니다. 사용자는 감정적으로 지지와 이해를 필요로 하는 것으로 보입니다.\", \"time_based_emotions\": {\"00:33\": [\"중립적\", 50, \"단순한 인사와 질문으로 감정 상태를 드러내지 않음\"], \"04:12\": [\"부정적\", 30, \"정신 상태에 대한 불안정한 감정 표현\"], \"04:44\": [\"부정적\", 40, \"가족 문제에 대한 불안한 감정 표현\"], \"04:45\": [\"부정적\", 35, \"아들의 행동에 대한 불안한 감정 표현\"], \"06:16\": [\"중립적\", 50, \"단순한 인사와 질문으로 감정 상태를 드러내지 않음\"]}, \"recommendations\": [\"정신적 불안정 감정에 대한 전문가와의 상담을 고려해 보세요.\", \"정서적 지지와 이해를 받을 수 있는 가족이나 친구와 감정에 대해 이야기해 보세요.\"]}'),(44,'FlcuDLxVC9SolW70','2025-02-17 07:36:41',41,0,'{\"overall_emotional_state\": \"사용자는 반복적인 인사와 간단한 질문을 통해 감정적인 불안정함을 보이고 있습니다.\", \"emotional_insights\": \"사용자는 반복적으로 인사하며 감정적인 불안정함을 드러내고 있습니다. 이는 외로움이나 불안함을 반영할 수 있습니다. 또한, 가족 문제와 관련된 질문을 통해 걱정과 불안함을 표현하고 있습니다.\", \"time_based_emotions\": {\"00:33\": [\"부정적\", 40, \"사용자는 반복적인 인사로 불안정함을 보이고 있습니다.\"], \"04:12\": [\"부정적\", 30, \"정신 상태가 이상하다고 표현하며 불안함을 드러내고 있습니다.\"], \"04:44\": [\"부정적\", 50, \"가족 문제로 인한 걱정과 불안함을 표현하고 있습니다.\"], \"04:45\": [\"부정적\", 45, \"아들의 행동을 이상하게 느끼며 불안함을 표현하고 있습니다.\"]}, \"recommendations\": [\"정신적인 불안정함을 느끼신다면, 전문가와 상담을 통해 감정적인 지원을 받는 것이 좋을 것 같습니다.\", \"정서적인 불안정함을 해소하기 위해, 일상적인 루틴을 만들어 안정적인 환경을 조성해 보세요.\"]}'),(45,'FlcuDLxVC9SolW70','2025-02-17 08:18:47',40,0,'{\"overall_emotional_state\": \"사용자는 혼란스럽고 불안한 상태에 있는 것 같습니다.\", \"emotional_insights\": \"사용자는 반복적으로 인사를 하며 대화를 시도하고 있지만, 대화의 내용이 불안정하고 혼란스러워 보입니다. 특히 가족에 대한 걱정과 자신의 정신 상태에 대한 불안이 드러납니다.\", \"time_based_emotions\": {\"00:33\": [\"부정적\", 40, \"사용자는 반복적으로 인사를 하며 대화를 시도하고 있지만, 대화의 내용이 불안정하고 혼란스러워 보입니다.\"], \"04:12\": [\"부정적\", 30, \"정신 상태에 대한 불안이 드러납니다.\"], \"04:44\": [\"부정적\", 50, \"가족에 대한 걱정이 드러납니다.\"], \"07:45\": [\"부정적\", 40, \"사용자는 혼란스러워 보이며, 대화의 내용이 불안정합니다.\"]}, \"recommendations\": [\"정신적 불안정이 지속된다면, 전문가의 상담을 받아보는 것이 좋습니다.\", \"정신적, 감정적 안정을 위해 규칙적인 생활과 충분한 휴식을 취하세요.\"]}'),(46,'FlcuDLxVC9SolW70','2025-02-18 01:55:12',55,0,'{\"overall_emotional_state\": \"감정의 기복이 있는 상태\", \"emotional_insights\": \"사용자는 가족 문제로 인해 스트레스를 받고 있지만, 좋은 날씨와 음식에 대한 긍정적인 감정도 느끼고 있습니다. 또한, 대화 상대에 대한 감사와 위로의 감정도 표현하고 있습니다.\", \"time_based_emotions\": {\"01:12\": [\"부정적\", 40, \"아들의 행동에 대한 불만과 스트레스\"], \"01:16\": [\"긍정적\", 70, \"좋은 날씨에 대한 긍정적인 감정\"], \"01:19\": [\"긍정적\", 60, \"음식에 대한 긍정적인 감정\"], \"01:24\": [\"중립적\", 50, \"겨울에 대한 감정\"], \"01:25\": [\"긍정적\", 80, \"대화 상대에 대한 감사\"], \"01:27\": [\"부정적\", 30, \"정서적 상실에 대한 슬픔\"]}, \"recommendations\": [\"정서적 스트레스를 줄이기 위해 가족과의 대화 시간을 가져보세요.\", \"정서적 안정을 위해 날씨가 좋을 때 산책을 하거나, 좋아하는 음식을 즐겨보세요.\"]}'),(47,'FlcuDLxVC9SolW70','2025-02-18 01:55:42',55,0,'{\"overall_emotional_state\": \"감정의 기복이 있지만 전반적으로 긍정적임\", \"emotional_insights\": \"사용자는 가족 문제로 인해 약간의 스트레스를 받고 있지만, 좋은 날씨와 음식에 대한 긍정적인 감정도 표현하고 있습니다. 또한, 대화 상대에 대한 감사와 위로의 감정도 나타내고 있습니다.\", \"time_based_emotions\": {\"01:12\": [\"부정적\", 40, \"아들의 행동에 대한 불만\"], \"01:16\": [\"긍정적\", 70, \"좋은 날씨에 대한 긍정적인 감정\"], \"01:19\": [\"긍정적\", 60, \"음식에 대한 긍정적인 감정\"], \"01:24\": [\"중립적\", 50, \"계절에 대한 인식\"], \"01:25\": [\"긍정적\", 80, \"대화 상대에 대한 감사\"], \"01:27\": [\"부정적\", 30, \"정서적 상실에 대한 슬픔\"]}, \"recommendations\": [\"정서적 스트레스를 줄이기 위해 가족과의 대화 시간을 늘려보세요.\", \"정기적으로 산책이나 야외 활동을 통해 긍정적인 감정에 집중하세요.\"]}'),(48,'FlcuDLxVC9SolW70','2025-02-18 10:06:43',67,0,'{\"overall_emotional_state\": \"긍정적이며 약간의 피로감이 있는 상태\", \"emotional_insights\": \"사용자는 가족과의 관계에서 약간의 스트레스를 느끼고 있지만, 전반적으로 긍정적인 감정 상태를 유지하고 있습니다. 날씨와 음식, 새로운 가족 구성원에 대한 긍정적인 감정이 두드러집니다.\", \"time_based_emotions\": {\"01:12\": [\"부정적\", 40, \"둘째 아들에 대한 걱정과 스트레스\"], \"01:16\": [\"긍정적\", 70, \"좋은 날씨에 대한 긍정적인 감정\"], \"01:25\": [\"긍정적\", 80, \"봇의 존재에 대한 긍정적인 감정\"], \"08:27\": [\"긍정적\", 90, \"둘째 아이의 탄생에 대한 기쁨\"], \"10:03\": [\"부정적\", 50, \"피로에 대한 감정\"], \"10:04\": [\"긍정적\", 75, \"신선한 공기에 대한 긍정적인 감정\"]}, \"recommendations\": [\"정기적인 휴식과 충분한 수면을 통해 피로를 관리하세요.\", \"정신적, 감정적 스트레스를 줄이기 위해 가족과의 긍정적인 대화를 유지하세요.\"]}'),(49,'FlcuDLxVC9SolW70','2025-02-19 05:45:58',67,0,'{\"overall_emotional_state\": \"긍정적이고 행복한 상태\", \"emotional_insights\": \"사용자는 처음에는 피로를 느꼈지만, 대화를 통해 기분이 좋아졌습니다. 대화가 진행됨에 따라 행복한 감정이 지속되었습니다.\", \"time_based_emotions\": {\"10:58\": [\"부정적\", 30, \"사용자는 피로를 느꼈습니다.\"], \"10:59\": [\"긍정적\", 70, \"신선한 공기를 마시며 기분이 좋아졌습니다.\"], \"11:00\": [\"긍정적\", 80, \"기분이 좋은 하루를 보내고 있습니다.\"], \"11:03\": [\"긍정적\", 90, \"대화로 인해 행복한 감정이 지속되었습니다.\"]}, \"recommendations\": [\"정기적으로 신선한 공기를 마시며 산책을 해보세요.\", \"긍정적인 대화를 지속적으로 나누며 기분을 유지하세요.\"]}');
